(478, 1, 'King Floyds Cocktail Rim Salt Variety Combo 2 Pack | Sriracha & Sea Flake | 4 oz | Fleur de Sel', 'King Floyd''s Sriracha Sea Salt blends the mildly spicy, zesty fire of sun-ripened chili sauce with premium, crunchy, sea salt. In addition to the world famous Thai hot sauce we infuse a secret blend of herbs and spices into our salt, giving it a fiery flavor punch. <br><br> Add a zesty bit of flame to your Bloody Mary or spicy Margarita with our Sriracha blend. The sea salt melts quickly and evenly, making it perfect for cooking your favorite meat and sea food dishes. <br><br> ------ <br><br> King Floyd''s Sea Flake Rim Salt is the perfect rimming salt. Only under precise environmental conditions, and with a great deal of time and effort, can one produce a true Fleur de Sel crystal. We source our Sea Flake salt from salt makers in cooler climates who, through a process know as thermal evaporation, are able to emulate the light fluffy crystals of Fleur de Sel. This process, when used with special pans to evaporate the brine, produces flaky pyramid shaped crystals that are perfect to rim your glass. <br><br> Perfect for rimming cocktails and of course your favorite Margarita.', '0407U1392QQ', 'QP-UEMV-F9HU', 19.99, '0', '2018-04-06 21:07:55 PDT', '', 'y', 1, '', '', '11', '', '', '', 'B07C11K1Y1', '', '', '', '', '', 'B07C11K1Y1', '', '', '0', 'DEFAULT', '', '', '', '', '', '', '', '', '', '', '', '', 'Migrated Template', '', '', '', '', '', '', '2018-05-18 12:02:06'),
