(485, 1, 'U Gottabee Nutz 4 Flavor Variety Pack | Smoky Bacon & Blue Cheese - Basil & Sun-dried Tomato - Balsamic Habanero - Caramel & Sea Salt', 'Smoky Bacon & Blue Cheese: If you like blue cheese, you will love the smoky bacon flavors combined with the buttery almonds and tangy cheese. Pairs well with honey and dried fruit, or fresh apple and pear slices. <br> <br> Basil & Sun-dried Tomato: The sweet hint of basil combined with the deep flavors of the sun-dried tomatoes creates this deliciously savory treat. These almonds are great solo or try with a nice a creamy Brie or flavorful Pecorino-Romano. <br> <br> Balsamic Habanero: Bold balsamic and spicy habanero are a great combo for the distinct flavors of pistachios. Try along side guacamole and tortilla chips, Spanish chorizo, peppered salamis or a cold bubbly drink. <br> <br> Caramel & Sea Salt: The combination of sweet molasses caramel and sea salt are a heavenly match for these buttery cashews. Tasty with baked pears and vanilla ice cream, or crisp tart apple slices and triple cream Brie.', '0416UZYFORW', 'REDBUND1', 21.99, '0', '2018-04-16 01:17:37 PDT', '', 'y', 1, '', '', '11', '', '', '', 'B07C75NV53', '', '', '', '', '', 'B07C75NV53', '', '', '0', 'DEFAULT', '', '', '', '', '', '', '', '', '', '', '', '', 'Migrated Template', '', '', '', '', '', '', '2018-05-18 12:02:06'),
